import React from 'react';
// import { Flex, Text, Heading, Image, Box } from '@chakra-ui/react';/
import img from '../assets/devil.png';
const GameModel = () => {
  return (
    <div className="gameInner">
      <div className="gameWrapper">
        <h2 className="gameHeading">Breaking Down the Metamon Gaming Model</h2>
        <div className="gg">
          <img src={img} alt="" />
          <p className="overl">
            Metamon Exploration: Users can explore the levels to obtain rewards
            and reach higher levels for their Metamon. Higher levels, better
            attributes, and stronger skills make the user's Metamon more
            valuable.
          </p>
        </div>
      </div>
    </div>
  );
};

export default GameModel;
